INSERT INTO `pageinfo` VALUES ('http://www.haonr.com/sjjg/show.php?itemid=4658', '2015-08-22', ' 昌邑宏大：　　大姜、面姜：　　　　水洗姜：2.60-3.15元/斤（好姜）。　　　　水洗姜：2.35-2.60元/斤（主流）。　　　　水洗姜：2.10-2.30元/斤（次货）。  推荐经纪人： 吴学民 13792651828 宏大大姜批发市场 昌邑琨福：　　大姜、面姜：　　　　水洗姜：2.60-3.10元/斤（好姜）。　　　　水洗姜：2.35-2.60元/斤（主流）。　　　　水洗姜：2.10-2.30元/斤（次货）。 推荐经纪人：　　齐继生　13356725816　山东省潍坊市昌邑市坤福大姜交易市场 昌邑石埠：　　大姜、面姜：      水洗姜：2.60-2.90元/斤（好姜）。　　　　水洗姜：2.20-2.55元/斤（主流）。　　　　水洗姜：2.00-2.10元/斤（次货）。 　昌邑大章：　　大姜、面姜：      水洗姜：2.60-2.85元/斤（好姜）。　　　　水洗姜：2.30-2.50元/斤（主流）。　　　　水洗姜：2.00-2.15元/斤（次货）。   【昌邑市场行情】昌邑宏大市场今天上货爆满大约500车，价格跟昨天持平但是略显偏弱，农户出货快不咬价，市场走货速度快。宏大报价好姜价格：2.60-3.20元/斤，主流价格：2.35-2.60元/斤，次货价格2.10-2.30元/斤。琨福市场今日上货大约400车左右，今天价格于昨天相同，农户对价格已经认可，市场上货快，下货速度也快。琨福报价好姜价格：2.60-3.10元/斤，主流价格：2.35-2.60元/斤，次货价格2.10-2.30元/斤。大章市场今天上货70车左右，走货速度较快，报价好姜:2.85元/斤左右。石埠市场今天上货90车左右，走货速度一般，好姜报价2.90/斤~【小编有话说；以后报价只分三等，好姜，主流，次货，去掉了精品和很差的姜，只报中间综合价格，所以不要问今天有3.00以上的啊，也有2.00以下的啊，这样的都很少，还是那话多参考主流价格~今天昌邑各个市场上货量都大大增加，价格持平略显偏弱，市场综合主流价格在2.2--2.6左右~】', '370786', '1');
